UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'VCSH' THEN 1.127 WHEN 'CFO' THEN 0.34 WHEN 'GSEU' THEN 1.645 WHEN 'PRVT' THEN 0.9019 WHEN 'SPTM' THEN 0.9289999999999999 WHEN 'IHDG' THEN 1.1800000000000002 WHEN 'ULVM' THEN 0.5469999999999999 WHEN 'RSPS' THEN 0.8300000000000001 WHEN 'PBW' THEN 0.45799999999999996 WHEN 'DWM' THEN 1.7120000000000002 WHEN 'STXT' THEN 0.326 WHEN 'SPYC' THEN 0.36 WHEN 'MMKT' THEN 0.302 WHEN 'MQQQ' THEN 0.007 WHEN 'FDLO' THEN 0.895 WHEN 'PFUT' THEN 0.008 WHEN 'EWU' THEN 2.967 WHEN 'ESGU' THEN 1.498 WHEN 'DXIV' THEN 1.196 WHEN 'AGIH' THEN 0.305
    END,
    updatedat = NOW()
    WHERE symbol IN ('VCSH', 'CFO', 'GSEU', 'PRVT', 'SPTM', 'IHDG', 'ULVM', 'RSPS', 'PBW', 'DWM', 'STXT', 'SPYC', 'MMKT', 'MQQQ', 'FDLO', 'PFUT', 'EWU', 'ESGU', 'DXIV', 'AGIH');